// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Hospital.sol";

contract AccessControlContract {

    address public hospitalRecordsContractAddress;

    constructor(address _hospitalRecordsContractAddress) {
        hospitalRecordsContractAddress = _hospitalRecordsContractAddress;
    }

    mapping(address => mapping(address => bool)) public patientPermissions;
    mapping(address => address) public hospitalToPatient;

    modifier onlyPatient() {
        require(msg.sender == hospitalToPatient[msg.sender], "Only patients can call this function");
        _;
    }

    function revokeAccess(address _patientAddr, address _hospitalAddr) public onlyPatient {
        require(patientPermissions[_patientAddr][_hospitalAddr], "Permission not granted");
        patientPermissions[_patientAddr][_hospitalAddr] = false;
    }

    function givePermission(address _patientAddr, address _hospitalAddr) public onlyPatient {
        patientPermissions[_patientAddr][_hospitalAddr] = true;
    }

    function getRegisteredHospitals() public view returns (address[] memory) {
        return HospitalRecords(hospitalRecordsContractAddress).getHospitalList();
    }
}
